import React from 'react'
import './HeroSection.css'
import { Button } from "./Button";
import blueBG from '../resources/images/blueBG.jpg';

function Footer() {
    return (
        <div className='hero-container'>
            <img src={blueBG} alt="logo"/>

        </div>
    )
}
export default Footer
